import React from "react";

const MissionStatement = () => {
  return (
    <div className="section">
      <h2>Mission Statement</h2>
      <ul>
        <li><strong>Revolutionizing Healthcare Access</strong>: We aim to make it easy for patients to book hospital appointments with a simple and user-friendly app.</li>
        <li><strong>Improving Patient Experience</strong>: Our app offers live tracking, online consultations, ambulance bookings, meal planning, and health records managementâ€”all in one place.</li>
        <li><strong>Centralizing Health Data</strong>: We bring together patient information in a single platform to improve diagnoses, treatments, and communication between doctors and patients.</li>
        <li><strong>Simplifying Healthcare Interactions</strong>: We make it easier for patients to connect with healthcare services, saving them time and effort.</li>
        <li><strong>Building a Healthier Community</strong>: Our goal is to make quality healthcare accessible to everyone, contributing to a healthier society.</li>
      </ul>
    </div>
  );
};

export default MissionStatement;
